/****************************************
*										*
*			DELTA DATA MOVING			*
*										*
****************************************/

/*	ENT	:   ATR_SPD(A0)
*		    ATR_CRS(A0)

*	EXT	:   d1.w:???h?
*		:   d2.w:???h?

*	DESTORY	:   D0,D1,D2,D3,D4
*		    A1,A6
*/

void gemini(ACTION *a0)
{
	Sint32_ d1,d2,d3,d4,d5,d6;
	Sint32_ d0;
	Uint16 a1;
	d5=((Sint32_)ATR_H_POS(a0))<<16;
	d6=((Sint32_)ATR_V_POS(a0))<<16;
	d5+=(Sint32_)(ATR_H_MINI(a0))<<8;
	d6+=(Sint32_)(ATR_V_MINI(a0))<<8;
	if(!(d0=ATR_SPD(a0)))
		return;
	d0--;
	a1=((Uint16)d0)<<6;		/*32(DIR)*2(H/V)*2(unsigned char)=128BYTE*/
	d0=ATR_CRS(a0);			/*COURSE $00 ~ $1F*/
	a1+=((Uint16)d0)*2;

	d1=(Sint32_)(DELTA_TBL[a1]);		/*H DELTA*/
	d1=d1<<8;
	d5+=d1;

	d1=(Sint32_)(DELTA_TBL[a1+1]);		/*V DELTA*/
	d1=d1<<8;
	d6+=d1;

	d3=(Sint32_)(ATR_H_POS(a0));
	d4=(Sint32_)(ATR_V_POS(a0));
	d1=d5>>16;
	d2=d6>>16;
	d1-=d3;
	d2-=d4;
	ATR_H_MINI(a0)=(int)((d5>>8)&0x000000ff);
	ATR_V_MINI(a0)=(int)((d6>>8)&0x000000ff);
	ATR_H_POS(a0)+=(int)d1;
	ATR_V_POS(a0)+=(int)d2;
}
